import { useState } from "react";

import {
  Navbar,
  Space,
  Divider,
  Button,
  Avatar,
  Text,
  Title,
  Flex,
  Container,
  Group,
  AppShell,
  SimpleGrid,
  TextInput,
  Tooltip,
} from "@mantine/core";
import { IconUser, IconKey, IconBell, IconLogout } from "@tabler/icons-react";

import AccountNavbar from "../components/AccountNavbar";

const user = {
  firstName: "John",
  surName: "Doe",
  email: "admin@example.com",
  phone: "+1 234 567 890",
  avatar: "https://avatars.githubusercontent.com/u/25126241?v=4",
};

const Account = () => {
  return (
    <Container>
      <Flex justify="center">
        <Title>Edit Profile</Title>
      </Flex>
      <Flex justify="center">
        <Avatar size={120} radius={120} src={user.avatar} />
      </Flex>
      <SimpleGrid columns={1} breakpoints={[{ minWidth: "sm", cols: 2 }]}>
        <TextInput label="First Name" defaultValue={user.firstName} />
        <TextInput label="Last Name" defaultValue={user.surName} />
      </SimpleGrid>
      <TextInput label="Email" defaultValue={user.email} />
      <TextInput label="Phone" defaultValue={user.phone} />

      <Divider mt="xl" mb="xl" />

      <Flex justify="center">
        <Title>Edit Adress</Title>
      </Flex>
      <TextInput
        label="Adress line 1"
        placeholder="Street name and house number"
      />
      <TextInput label="Adress line 2" placeholder="Apartment, unit etc." />
      <TextInput label="City" placeholder="City/Town" />
      <TextInput label="Zip" placeholder="Postcode/Zip" />
      <TextInput label="County" placeholder="Country" />

      <Flex justify="center">
        <Button variant="filled">Save</Button>
      </Flex>
    </Container>
  );
};
const Password = () => {};
const Notifications = () => {};

const data = [
  {
    label: "Account",
    icon: <IconUser stroke={1.5} />,
    element: <Account />,
  },
  {
    label: "Password",
    icon: <IconKey stroke={1.5} />,
    element: <Password />,
  },
  {
    label: "Notifications",
    icon: <IconBell stroke={1.5} />,
    element: <Notifications />,
  },
];

const labels = data.map((item) => {
  return { label: item.label, icon: item.icon };
});

const NavBar = () => {
  <Navbar height={"100%"} p="xs" width={{ base: 80 }}>
    <Navbar.Section grow>
      {data.map((item, index) => {
        return (
          <Tooltip label={item.label} position="right">
            <Button
              key={index}
              variant={index === active ? "filled" : "subtle"}
              fullWidth
              onClick={() => {
                setActive(index);
              }}
            >
              {item.icon}
            </Button>
          </Tooltip>
        );
      })}
    </Navbar.Section>

    <Navbar.Section>
      <Tooltip label="Logout" position="right">
        <Button variant="subtle" fullWidth>
          <IconLogout stroke={1.5} />
        </Button>
      </Tooltip>
    </Navbar.Section>
  </Navbar>;
};

const AccountPage = () => {
  const [active, setActive] = useState(0);

  return (
    <Flex>
      <Navbar height={"100%"} p="xs" width={{ base: 80 }}>
        <Navbar.Section grow>
          {data.map((item, index) => {
            return (
              <Tooltip label={item.label} position="right">
                <Button
                  key={index}
                  variant={index === active ? "filled" : "subtle"}
                  fullWidth
                  onClick={() => {
                    setActive(index);
                  }}
                >
                  {item.icon}
                </Button>
              </Tooltip>
            );
          })}
        </Navbar.Section>

        <Navbar.Section>
          <Tooltip label="Logout" position="right">
            <Button variant="subtle" fullWidth>
              <IconLogout stroke={1.5} />
            </Button>
          </Tooltip>
        </Navbar.Section>
      </Navbar>
      <Account />
    </Flex>
  );
};

export default AccountPage;
